import React, { useState } from "react";
import "./Quote.css";

function GetQoute() {
	const [click, setClick] = useState(false);

	return (
		<div className="ctForm">
			<Link to="/Quote">
				<button className={click ? "btn active" : "btn"}>Get Quote</button>
			</Link>
			<h2 className="ctu">Contact Us</h2>
			<form className="cf">
				<input type="text" id="input-name" placeholder="Name"></input>
				<input type="email" id="input-email" placeholder="Email address"></input>
				<input type="text" id="input-subject" placeholder="Subject"></input>
				<textarea name="message" type="text" id="input-message" placeholder="Message"></textarea>
				<input type="submit" value="Submit" className="formBtn"></input>
			</form>
		</div>
	);
}
export default GetQoute;
